<template>
  <i class="iconfont" :style="{'color': color,'fontSize': size + 'px'}" @click="_onClick">{{icons[type]}}</i>
</template>


<script>
	import icons from './icons.js';

	export default {
		name: 'wlpIcons',
		props: {
			type: {
				type: String,
				default: ''
			},
			color: {
				type: String,
				default: '#333333'
			},
			size: {
				type: [Number, String],
				default: 16
			}
		},
		data() {
			return {
				icons: icons
      }
		},
		methods: {
			_onClick() {
				this.$emit('click')
			}
		}
	}
</script>
